import React from 'react'
import { businessLinks } from '../constants'


const Business = () => {
  return (
    <div>
      <ul className='grid grid-row-4'>
      {
        businessLinks.map((business,index) => (
          <li>{business.type}
          <img src = {business.image} alt = "cuisinetype"/>
          <p>{business.content}</p>
          </li>
        ))
      }
      </ul>
    </div>
  )
}

export default Business
